import Link from 'next/link'

function Home({posts}) {
    console.log(posts)
  return (
    <ul>
        {posts.map((ele, index) => (
            <li key={ele.id}>
                <Link href={ele.name}>
                    <a>{ele.name}</a>
                </Link>
            </li>
        ))}
    </ul>
  )
}

export async function getStaticProps() {
    const posts = [
        {
            name: '/home/about',
            id: 1
        },
        {
            name: '/home/second',
            id: 2
        }
    ]
    return {
        props: {
            posts
        }
    }
}

export default Home
